    "2016-05-31T01:09:08.232023",nt"name": "2015-hawaii-se-island-uas-orthomosaic",nt"isopen":
    false,nt"url": null,nt"notes": "This imagery was captured September 20,
    2015 for the Hawaiian Monk Seal Research Program. Unmanned Aircraft Systems (UAS)
    are being tested to assess their effectiveness for capturing images of seals and
    other wildlife. In addition to single photographs, an orthomosaic of Southeast Island
    was created as part of a mapping exercise over the island using an APH-22 hexacopter.
    The mosaic output is a GeoTIFF in WGS84 UTM Zone 1N. Mission support: Charles Littnan
    NOAA, Jessica Lopez Bohlander NOAA, LT Michael Marino NOAA UAS planning and flight:
    Kathryn Sweeney NOAA, Don LeRoi of Aerial Imaging Solutions Map compilation: Joel
    Stocker for AIS.",nt"license_title": null,nt"extras": [{ntt"key":
